import React from "react";

export const Home = () => {
  return (
    <section
      className="hero"
      style={{
        backgroundImage: "url('/images/home.PNG')",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        backgroundPosition: "center",
        backgroundAttachment: "fixed",
        height: "100vh",
        width: "100%",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        position: "relative",
      }}
    >
      <h1 style={{ color: "#e0a80d", fontSize: "60px", fontWeight: "bold" }}>
        Literatur-Score
      </h1>
    </section>
  );
};

export default Home;
